import React, { useState } from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import Todos from './pages/ToDosTodos'; // העתקי את הקוד הקיים שלך ל-Todos.js
import Login from './pages/Login';
import Register from './pages/RegisterRegister';

function App() {
  const [token, setToken] = useState(localStorage.getItem('token'));

  return (
    <BrowserRouter>
      <header>
        <nav>
          <Link to="/">משימות</Link> | 
          {!token && <Link to="/login">התחברות</Link>} | 
          {!token && <Link to="/register">הרשמה</Link>}
        </nav>
      </header>

      <Routes>
        <Route path="/" element={<Todos />} />
        <Route path="/login" element={<Login onLogin={setToken} />} />
        <Route path="/register" element={<Register onLogin={setToken} />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
